import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Text, Button, View, Alert, Image,TouchableOpacity } from 'react-native';
import {styles} from './style';
//import Navigator from './routes/homeStack';

export default function App() {
  const alertHandler = () => {
    Alert.alert('consumer pressed')
  }
  return (
    <View style = {styles.container}>
      <Image style = {styles.img3}
        source = {require('../images/welcome.png')}
      />
          <Image style = {styles.img_ac}
        source = {require('../images/icon/account.png')}
      />
      <TextInput style = {styles.account}/>
      <Image style = {styles.img_pw}
        source = {require('../images/icon/password.png')}
      />
      <TextInput style = {styles.password}/>
      <View style ={styles.container2}>
        <TouchableOpacity style={styles.f_wrapper}>
          <Text style={styles.f_Text}>忘记密码？</Text>
        </TouchableOpacity>
        <TouchableOpacity style={styles.f_wrapper}>
          <Text style={styles.r_Text}>注册账户</Text>
        </TouchableOpacity>
      </View>
      <TouchableOpacity style={styles.login_wrapper}>
        <Text style={styles.onsite_Text}>登陆</Text>
      </TouchableOpacity>
      <Image style = {styles.img4}
        source = {require('../images/icon/logo.png')}
      />
    </View>
  );
}
